        // GET: api/5
        [HttpGet("{id}")]
        public async Task<ActionResult<Post>> GetPostModel(int id)
        {
            var postModel = await _context.Posts.FindAsync(id);

            if (postModel == null)
            {
                return NotFound();
            }

            return postModel;
        }

        // GET: api/notapproved
        [HttpGet("notapproved")]
        public async Task<ActionResult<List<Post>>> GetPostModel()
        {
            var postModel = await _context.Posts.Where(x => x.Approved == false).ToListAsync();

            if (postModel == null)
            {
                return NotFound();
            }

            return postModel;
        }

        // PUT: api/upvote/4
        [HttpPut("upvote/{id}")]
        public async Task<IActionResult> UpvotePost(int? id)
        {
            var model = _context.Posts.FirstOrDefault(x => x.Id == id);

            if (model is null)
                return BadRequest();

            model.Upvote += 1;
            _context.Update(model);

            await _context.SaveChangesAsync();

            return Ok();
        }

        // PUT: api/approve/5
        [HttpPut("approve/{id}")]
        public async Task<IActionResult> PutPostModel(int? id)
        {
            var model = _context.Posts.FirstOrDefault(x => x.Id == id);

            if(model is null) 
                    return BadRequest();

            model.Approved = true;
            _context.Update(model);

            await _context.SaveChangesAsync();

            return Ok();
        }

        // PUT: api/dissapprove/4
        [HttpPut("dissapprove/{id}")]
        public async Task<IActionResult> DissaprovePutPostModel(int? id)
        {
            var model = _context.Posts.FirstOrDefault(x => x.Id == id);

            if (model is null)
                return BadRequest();

            model.Approved = false;
            _context.Update(model);

            await _context.SaveChangesAsync();

            return Ok();
        }

        // GET: api/posts
        [HttpGet("posts")]
        public PostsResponse GetPostModel([FromQuery] QueryParameters parameters)
        {
            var page = parameters.page;
            var size = parameters.size;
            var sort = parameters.sort;
            var category = parameters.category;
            var approved = parameters.approved;
            var positive = parameters.positive;
            var sortByVotes = parameters.sortByVotes;

            if (page == 0)
                page = 1;

            if (size == 0)
                size = int.MaxValue;

            var skip = (page - 1) * size;

            var query = _context.Posts.AsQueryable();

            if (!String.IsNullOrEmpty(category))
            {
                query = query.Where(x => x.Category == category);
            }

            if (approved is not null)
            {
                query =  query.Where(x => x.Approved == approved);
            }

            if (positive is not null)
            {
                query =  query.Where(x => x.Positive == positive);
            }

            double count = query.Count();

            query = query.Skip(skip).Take(size);

            if (!String.IsNullOrEmpty(sort))
            {
                if (sort.Equals("asc"))
                {
                    if (sortByVotes == true)
                    {
                        query = query.OrderBy(x => x.Upvote);
                    }
                    else
                    {
                        query = query.OrderBy(x => x.CreatedDate);
                    }
                }
                else if (sort.Equals("desc"))
                {
                    if (sortByVotes == true)
                    {
                        query = query.OrderByDescending(x => x.Upvote);
                    }
                    else
                    {
                        query = query.OrderByDescending(x => x.CreatedDate);
                    }
                }
            }

            return new PostsResponse((int)Math.Ceiling(count / size),query.AsEnumerable());
        }

        // DELETE: api/5
        [HttpDelete("{id}")]
        public async Task<IActionResult> DeletePostModel(int id)
        {
            var postModel = await _context.Posts.FindAsync(id);
            if (postModel == null)
            {
                return NotFound();
            }

            _context.Posts.Remove(postModel);
            await _context.SaveChangesAsync();

            return NoContent();
        }

        // POST: api/post
        [HttpPost("post")]
        public async Task<ActionResult<Post>> PostModel(Post postModel)
        {
            var dg = new GarbageDetector();
            if (postModel.Category.Equals("Smece"))
            {
                var returnImage = await dg.DetectGarbage(postModel.Image64);
                postModel.Image64 = "data:image/jpeg;base64," + returnImage;
            }

            _context.Posts.Add(postModel);
            await _context.SaveChangesAsync();

            return CreatedAtAction(nameof(PostModel), new { id = postModel.Id }, postModel);
        }
    }

    public class QueryParameters
    {
        public int size { get; set; }
        public int page { get; set; }
        public string? category { get; set; }
        public bool? approved { get; set; }
        public bool? positive { get; set; }
        public string? sort { get; set; }
        public bool? sortByVotes { get; set; }
    }

    public class PostsResponse
    {
        public int numberOfPages { get; set; }
        public IEnumerable<Post> posts { get; set; }

        public PostsResponse(int v, IEnumerable<Post> enumerable)
        {
            this.numberOfPages = v;
            this.posts = enumerable;
        }
    }
}
